package Utiles

import (
	"bytes"
	"encoding/json"
	"fmt"
	"io/ioutil"
	"net/http"
)

const apiUrl = "http://10.231.143.223:18991/hit/xrobot"
const contentType = "application/json"

//定义请求体格式
type AutoGenerated struct {
	Intent  string  `json:"intent"`
	Request Request `json:"request"`
}
type Request struct {
	Tenantid     string                 `json:"tenantid"`
	Appid        string                 `json:"appid"`
	Skill        string                 `json:"skill"`
	CurTimestmap string                 `json:"cur_timestmap"`
	CdcTimestamp string                 `json:"cdc_timestamp"`
	CdcTableName string                 `json:"cdc_table_name"`
	DelayValue   int                    `json:"delay_value"`
	Content      map[string]interface{} `json:"content"`
}

func PushMetricsToFaas(s map[string]interface{}) {
	para := AutoGenerated{
		Intent: "API",
		Request: Request{
			Tenantid:     "MarketCenter_SaleTeam",
			Appid:        "streamsets_monitor",
			Skill:        "adbStreamsets-sinkMsgToEs",
			CurTimestmap: "1635304148000",
			CdcTimestamp: "1635304148000",
			CdcTableName: "12345678",
			DelayValue:   30009,
			Content:      s,
		}}

	paraJson, _ := json.Marshal(para)
	resp, _ := http.Post(apiUrl, contentType, bytes.NewReader(paraJson))
	body, _ := ioutil.ReadAll(resp.Body)
	fmt.Println(string(body))
}

func MapToJson(param map[string]interface{}) string {
	dataType, _ := json.Marshal(param)
	dataString := string(dataType)
	return dataString
}

func GetJMxMsg(ip string, port string) string {
	var url = fmt.Sprintf("http://%s:%s/metrics", ip, port)
	data := Get(url)
	return data
}

